import { Fragment } from 'react';

import MainNavigation from './MainNavigation';
import Footer from './Footer';
import BG from "../../assets/bgimage.jpg";

const Layout = (props) => {
  return (
    <Fragment  >
      <MainNavigation />
      <main style={BG}>{props.children}</main>
      <Footer />
    </Fragment>
  );
};

export default Layout;
